import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";

const Index = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Box
        style={{
          borderRadius: "5px",
          width: "390px",
          height: "440px",
          backgroundColor: "#F7F7F7",
          padding: "20px",
          margin: "80px",
        }}
      >
          <Typography style={{ color:"333333",textAlign:"center",fontSize:"30px "}}>Sign in </Typography>
      </Box>
    </div>
  );
};
export default Index;
